  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the results of Prime
  Hook National Wildlife Refugeu2019s 1996 annual water management program and describes
  plans for 1997. The main objective of this annual program is to increase the carrying
  capacity of the refuge's marshes by maximizing the production of diverse food resources
  and provide various marsh habitat-types to meet the multiple needs of as many wetland-dependent
  species as possible, while specifically targeting migrating waterfowl and shorebirds.\",\n\t\"owner_org\":
